import React, { useEffect } from 'react';
import { useStateContext } from '../context/StateContext';
import { useNavigate } from 'react-router-dom';

const MessagePanel = () => {
  const { messages, normalizedTables, fetchNormalizedTables, setSelectedTable } = useStateContext();
  const navigate = useNavigate();

  useEffect(() => {
    fetchNormalizedTables();
    // Empty dependency array → only runs once on mount.
  }, [fetchNormalizedTables]);

  const handleTableClick = (tableName) => {
    setSelectedTable(tableName);
    navigate('/table-view');
  };

  return (
    <div>
      <div>
        <h4>Messages</h4>
        {messages.map((msg, idx) => (
          <div key={idx}>{msg}</div>
        ))}
      </div>
      <div>
        <h4>Normalized Tables</h4>
        {normalizedTables.map((table, idx) => (
          <button key={idx} onClick={() => handleTableClick(table)}>
            {table}
          </button>
        ))}
      </div>
    </div>
  );
};

export default MessagePanel;
